import { useState } from "react";
import st from "./Regist.module.scss";

const Regist = () => {
  const [isActive, setIsActive] = useState<"en" | "ko" | "false">("false");
  const registVoca = async () => {
    console.log("clicked");
    await fetch("http://localhost:8000/regist", {
      method: "POST",
      body: JSON.stringify({
        id: "id test",
        title: "title test",
        chapter: "chapter test",
      }),
    });
  };

  return (
    <section className={st.regist_container}>
      <div className={st.form_container}>
        <div className={st.input_container}>
          <input
            type="text"
            placeholder="EN"
            onKeyUp={() => setIsActive("en")}
            className={`${isActive && st.isActive}`}
          />
          <input
            type="text"
            placeholder="KO"
            onMouseDown={() => setIsActive("ko")}
            className={`${isActive && st.isActive}`}
          />
        </div>
        <button>Submit</button>
      </div>
      <table>
        <th>
          <td>
            <input />
          </td>
        </th>
        <tr>
          <td>
            <input />
          </td>
        </tr>
        <button onClick={() => registVoca()}>button</button>
      </table>
    </section>
  );
};

export default Regist;
